import React, { Component,useEffect } from 'react';
import './contactcut.css';
import Aos from 'aos';
import Img from './contact1.jpg';
import {Link} from 'react-scroll';

const ContactCut = () => {

    return (
        
    	<div id="contact">
      <div style={{backgroundColor:'#f3f3f1',width:150,height:100,position:'absolute',top:0,left:0}}></div>

        
            
        </div>
    );
}

export default ContactCut;
